import { ColumnNumber, FirstColumn, DataColumn, CommentColumn, Thead, Button } from "./Table.style";
import { Icon, IconAbsolute, IconSmall } from "./IconComponent/Icon";
import { RowType } from "./Table";
import { FC, useState } from "react";
import { TableStatus } from "../constants/TableType";
import { COLORS, ICONSTATUS } from "../constants/colors";
import styled from "@emotion/styled";
import { Box, Collapse, Table, TableCell, TableRow } from "@mui/material";
import { click } from "@testing-library/user-event/dist/click";

const statusColors: Record<TableStatus, string> = {
  [TableStatus.CANCELED]: COLORS.ORANGE,
  [TableStatus.AFFIRM]: COLORS.BLACK,
  [TableStatus.PROCESSING]: COLORS.BLUE,
  [TableStatus.DONE]: COLORS.POLARGREEN,
};
const iconStatus: Record<TableStatus, string> = {
  [TableStatus.CANCELED]: ICONSTATUS.CANCELED,
  [TableStatus.AFFIRM]: ICONSTATUS.CLOCK,
  [TableStatus.PROCESSING]: ICONSTATUS.INPROCESS,
  [TableStatus.DONE]: ICONSTATUS.DONE,
};
export const TableBody: FC<RowType> = (row) => {
  const ColumnStatus = styled("div")<{ color?: string }>`
    color: ${(props) => props.color};
    width: 240px;
    height: 56px;
    align-items: center;
    font-size: 14px;
    line-height: 22px;
    padding: 17px 16px;
    display: flex;
    font-weight: 500;
    position: relative;
  `;
  // console.log(iconStatus[row.status]);
  const [open, setOpen] = useState(false);
  let clicked = 0;
  const setOpenModal = () => {
    console.log("fdf");
    clicked = 1;
    // console.log(clicked);
  };
  console.log(clicked);
  return (
    <>
      <tr>
        <td style={{ borderTopLeftRadius: "10px" }}>
          <FirstColumn>
            {row.extraDoc?.length ? (
              <Button onClick={() => setOpen(!open)}>
                {open ? <Icon type="Minus" /> : <Icon type="Plus" />}
              </Button>
            ) : (
              ""
            )}
          </FirstColumn>
        </td>

        <td>
          <ColumnNumber style={{ justifyContent: "space-between" }}>
            {row.numberContract}

            <IconAbsolute type="Divider" />
          </ColumnNumber>
        </td>

        <td>
          <DataColumn>
            {row.startDate} <IconAbsolute type="Divider" />
          </DataColumn>
        </td>
        <td>
          <DataColumn>
            {row.finalDate} <IconAbsolute type="Divider" />
          </DataColumn>
        </td>
        <td>
          <CommentColumn>
            <IconAbsolute type="Divider" />
            <div onClick={setOpenModal}>
              {}
              <Icon type="Message" style={{ marginRight: "8px" }} />
              {row.commentInfo?.map((com) => (
                <div>
                  {com.isRead ? <IconSmall type="Dot" /> : ""}
                  {com.comments.length}
                </div>
              ))}
            </div>
          </CommentColumn>
        </td>
        <td>
          <ColumnStatus color={statusColors[row.status]}>
            {/* <Icon type="{iconStatus[row.status]}" /> */}
            {row.status}
            <IconAbsolute type="Divider" />
          </ColumnStatus>
        </td>
        <td style={{ borderTopRightRadius: "10px" }}>
          <ColumnNumber>
            <p>
              <a href={row.proceed}>proocced</a>
            </p>
            <br />
            <a href={row.download}>down</a>
          </ColumnNumber>
        </td>
      </tr>
      {row.extraDoc?.map((doc) => (
        <>
          <tr>
            <td colSpan={7}>
              <Collapse in={open} timeout="auto" unmountOnExit>
                <td>
                  <FirstColumn></FirstColumn>
                </td>

                <td>
                  <ColumnNumber style={{ justifyContent: "space-between" }}>
                    {doc.numberContract}

                    <IconAbsolute type="Divider" />
                  </ColumnNumber>
                </td>

                <td>
                  <DataColumn>
                    {doc.startDate} <IconAbsolute type="Divider" />
                  </DataColumn>
                </td>
                <td>
                  <DataColumn>
                    {doc.finalDate} <IconAbsolute type="Divider" />
                  </DataColumn>
                </td>
                <td>
                  <CommentColumn>
                    <IconAbsolute type="Divider" />

                    {doc.commentInfo?.map((com) => (
                      <div>
                        {com.isRead ? <IconSmall type="Dot" /> : ""}
                        <Icon type="Message" style={{ marginRight: "8px" }} />
                        {com.comments.length}
                      </div>
                    ))}
                  </CommentColumn>
                </td>
                <td>
                  <ColumnStatus color={statusColors[row.status]}>
                    {/* <Icon type="{iconStatus[row.status]}" /> */}
                    {doc.status}
                    <IconAbsolute type="Divider" />
                  </ColumnStatus>
                </td>
                <td style={{ borderTopRightRadius: "10px" }}>
                  <ColumnNumber>
                    <p>
                      <a href={doc.proceed}>proocced</a>
                    </p>
                    <br />
                    <a href={doc.download}>down</a>
                  </ColumnNumber>
                </td>
              </Collapse>
            </td>
          </tr>
        </>
      ))}
    </>
  );
};
